import { GetList } from '../../../Data/Database';
import React, { useState, useEffect } from "react"

export default function RsvpAdmin(props) {

    const [rsvps, setRsvps] = useState({});

    useEffect(() => {
        GetList(props.auth)
            .then(data => {
                setRsvps(data);
            }).catch(err => {
                console.log(err);
                ServerError(true);
            })
    })

    return (
        <ul>
        </ul>
    )
}
